},

    ]



function ServicesFAQ (){
  const [selec,Setselec]=useState(null)

  const tonggle= (index) =>{
    if(selec === index){
      return Setselec(null)
    }
    Setselec(index)
  }
    return(
        <div>
          <div className={clsx(style.ServicesFAQ)}>
            <div className={clsx(style.Serviceitem)}>
             <div className={clsx(style.Serviceitemoneone)}>
